            notes: "Returns an input stream for reading a resource in this module.\n\
              \ The name parameter is a '/'-separated path name that\n identifies\
              \ the resource. As with Class.getResourceAsStream, this method delegates\
              \ to the module's class\n loader findResource(String,String) method,\
              \ invoking it with the module name\n (or null when the module is unnamed)\
              \ and the name of the\n resource. If the resource name has a leading\
              \ slash then it is dropped\n before delegation.\n\n  A resource in a\
              \ named module may be encapsulated so that\n it cannot be located by\
              \ code in other modules. Whether a resource can be\n located or not\
              \ is determined as follows: \n\n \n      If the resource name ends with\
              \  \".class\" then it is not\n     encapsulated. \n\n      A package\
              \ name is derived from the resource name. If\n     the package name\
              \ is a package in the\n     module then the resource can only be located\
              \ by the caller of this\n     method when the package is open\n    \
              \ to at least the caller's module. If the resource is not in a\n   \
              \  package in the module then the resource is not encapsulated. \n \n\
              \n  In the above, the package name for a resource is derived\n from\
              \ the subsequence of characters that precedes the last '/' in\n the\
              \ name and then replacing each '/' character in the subsequence\n with\
              \ '.'. A leading slash is ignored when deriving the package\n name.\
              \ As an example, the package name derived for a resource named\n \"\
              a/b/c/foo.properties\" is \"a.b.c\". A resource name\n with the name\
              \ \"META-INF/MANIFEST.MF\" is never encapsulated\n because \"META-INF\"\
              \ is not a legal package name. \n\n  This method returns null if the\
              \ resource is not in this\n module, the resource is encapsulated and\
              \ cannot be located by the caller,\n or access to the resource is denied\
              \ by the security manager."
